import React from 'react';

function Team({ team }) {
  return (
    <div>
      <h2>Your Team (Max 11 players)</h2>
      {team.length === 0 ? (
        <p>No players in the team yet.</p>
      ) : (
        <ul>
          {team.map((player) => (
            <li key={player.id}>
              {player.name} - {player.position} - Rating: {player.rating}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default Team;
